import {Link} from 'react-router-dom'
import './Nav.css'
let Nav = () =>{
    return(
        <nav className='nav'>
            <p>Results Portal</p>
            <h5 id='t1'><Link to = '/'>Home</Link></h5>
            <h5><Link to = '/result'style={{color:"white",textDecoration:"none"}}>Results</Link></h5>
            <h5><Link to = '/add-results'>Store-Results</Link></h5>
        </nav>
    )
}
export default Nav;
